// Function to extract movie title IDs from the sourceHTML
const movieIds = [];
function getMovieIdsFromHTML(html) {
    // const movieIds = [];

    // Create a DOM parser to convert the HTML string into DOM elements
    const parser = new DOMParser();
    const doc = parser.parseFromString(html, 'text/html');

    // Select all elements with the class 'ipc-title-link-wrapper'
    const movieLinks = doc.querySelectorAll('.ipc-title-link-wrapper');

    // Iterate over the selected elements and extract movie IDs
    movieLinks.forEach(link => {
        // Extract the href attribute value
        const href = link.getAttribute('href');
        
        // Use a regular expression to find the movie ID (e.g., tt5645432)
        const match = href.match(/\/title\/(tt\d+)\//);
        
        // If a match is found, push the movie ID to the array
        if (match) {
            movieIds.push(match[1]);
            // createYtsDlList(match[1])
        }
    });

    console.log(movieIds); // Output the array of movie title IDs

    movieIds.forEach(id => {
        // console.log(id)
        const url = `https://yts.mx/api/v2/movie_details.json?imdb_id=${id}`
        fetch(url)
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok')
                }
                return response.json(); // Parse the JSON data
            })
                .then(data => {
                    if (data.data.movie.title != null) {
                        console.log(data.data.movie.title)
                        // console.log(data.data.movie.torrents)
                        const torrents = data.data.movie.torrents
                        torrents.forEach(torrent => {
                            console.log(`\tquality: ${torrent.quality}`)
                            console.log(`\tvideo_codec: ${torrent.video_codec}`)
                            console.log(`\tseeds: ${torrent.seeds}`)
                            console.log(`\tsize: ${torrent.size}`)
                            console.log(`\turl: ${torrent.url}`)
                        })
                    }
                })
            .catch(error => {
                console.error('There was a problem with the fetch operation:', error)
            })
    })
}

